        vector<int> R(n);// summation of v from right to left
        for(int i=n-1; i>=0; i--)  R[i] = i==n-1 ? v[i] : R[i+1] + v[i];
        int total = accumulate(v.begin(), v.end(),0);
        //for each pair(j,i) with j<=i, L[i]+R[j]-total is summartion from j to i

        unordered_map<int, priority_queue<int, vector<int>, greater<int>>> mp;
        for(int j = 0; j<n ;j++) {
            mp[R[j]].push(j);
        }
        
        int max_len=0;
        for(int i=0;i<n;i++) {
            //Find min j such that L[i] + R[j] - total == 0
            //=> we want search R[j] = total - L[i]
            auto& minq = mp[total-L[i]];
            if(!minq.empty()) {
                int j = minq.top();
                max_len = max(max_len, i-j+1);
            }
        }
        return max_len;
        
